import React from "react";
import footerlogo from "../assets/Logo.png"
import facebook from "../assets/facebook.png";
import instagram from "../assets/instagram.png";
import youtube from "../assets/youtube.png";

function Footer(){
    return(
      <div className="footer-container">
      <div className="footer-section1">
        <img src={footerlogo} className="footer-logo"/>
        <p className="section1-text">BikePulse is a dynamic software development team <br></br>with a global presence through offices in Canada<br></br> and the UAE. Since 2012, we have been at the <br></br>forefront of delivering cutting-edge web and mobile <br></br>solutions, providing customized software to clients <br></br>worldwide. Our commitment to innovation and<br></br> quality positions BikePulse Techware Lab as a<br></br> trusted partner, seamlessly merging technology with <br></br>the excitement of biking.</p>
        <div className="followus-container">
        <p className="footer-followus">Follow Us</p>
        <img src={facebook} alt="Facebook Logo" className="social-media-icon"/>
        <img src={instagram} alt="Instagram Logo" className="social-media-icon"/>
        <img src={youtube} alt="Youtube Logo" className="social-media-icon"/>

        </div>
      </div>
      <div className="footer-section2">
        <p className=""></p>
      </div>


      </div>
    );

}
export default Footer;
